  //       .then((response) => {
  //         response.
  //       })
  //       .catch((error) => {
  //         console.log(error);
  //       });
  //   }

  render() {
    return (
      <div>
        <span>Cluster: </span>
        <Select
          showSearch
          style={{ width: 200 }}
          placeholder="Select a tenant"
          optionFilterProp="children"
          onChange={onChange}
          onFocus={onFocus}
          onBlur={onBlur}
          onSearch={onSearch}
          filterOption={(input, option) =>
            option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
          }
        >
          <Option value="jack">Jack</Option>
          <Option value="lucy">Lucy</Option>
          <Option value="tom">Tom</Option>
        </Select>
        <Select
          showSearch
          style={{ width: 200 }}
          placeholder="Select a tenant"
          optionFilterProp="children"
          onChange={onChange}
          onFocus={onFocus}
          onBlur={onBlur}
          onSearch={onSearch}
          filterOption={(input, option) =>
            option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
          }
        >
          <Option value="jack">Jack</Option>
          <Option value="lucy">Lucy</Option>
          <Option value="tom">Tom</Option>
        </Select>
      </div>
    );
  }
}

export default SelelctTenant;
